import PostOptionsRow from "./PostOptionsRow.jsx";
import { BookmarkIcon, ExclamationIcon, TagIcon, TrashIcon } from '@heroicons/react/outline'
function PostoptionsModal() {
    return (
        <div className="relative">
            <PostOptionsRow Icon = {BookmarkIcon} title ="Wallet"/>
            <PostOptionsRow Icon = {TagIcon} title ="Settings"/>
            <PostOptionsRow Icon = {TrashIcon} title ="Help"/>
            <PostOptionsRow Icon = {ExclamationIcon} title ="Logout"/>
        </div>
    )
}

export default PostoptionsModal;
